import React, { Component } from 'react'
import logo from '../../logo.svg'
import '../../App.css'

interface Props {
    teste: string
}

interface State {
    teste: ''
}


class Inicio extends Component<Props, State> {

    constructor(props: Props) {
        super(props)
        this.teste = ''
    }

    handleChange(event) {
        console.log(event.target.value);
        this.teste = event.target.value
    }


    render() {
        return (
            <div className="App">
                <header className="App-header">
                    <input onChange={this.handleChange.bind(this)} className="App-logo" alt="logo" />
                </header>
            </div>
        )
    }
}

export default Inicio
